import Vue from 'vue'
import Router from 'vue-router'

import layout from '@/page/layout'
import login from '@/page/login'
import notfount from '@/page/404'

Vue.use(Router)

var constantRouterMap = [{
	path: '',
	component: layout,
	meta: {
		requireAuth: true
	},
	children: []
}, {
	path: '/login',
	component: login,
}]

export default new Router({
	mode: 'history',
	routes: constantRouterMap
})
